syntax = "proto2";
package org.apache.flink.pb.other;
option java_package = "org.apache.flink.pb.proto";
option java_outer_classname = "SimpleTestOuterMultiProto";
option java_multiple_files = true;

message SimpleTestOuterMulti {
    optional int32 a = 1;
    optional int64 b = 2;
    optional bool c = 3;
    optional float d = 4;
    optional double e = 5;
    optional string f = 6;
    optional bytes g = 7;
}

